import React,{Component} from 'react';

class Maman extends Component {
    state = {
        messageMaman : null,
        messageToto : null

    }
    ordreMams =()=>{
        this.setState({
            messageMaman : 'range ta chambre'
        })
    } 

    render() {
        return (
            <div className ="maman">
                <h1>Maman</h1>
                <button onClick ={this.ordreMams} >ordre de la mams</button>
                <p>{this.state.messageMaman}</p>
                <hr/>

            </div>
        )
    }
}

export default Maman;
